DROP TABLE IF EXISTS `db_ok_excel`;
CREATE TABLE `db_ok_excel` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `update_number` varchar(150) DEFAULT NULL COMMENT '上传数量',
