  `excel_path` varchar(255) DEFAULT NULL COMMENT 'excel地址',
  `courier_numbers` varchar(50) DEFAULT NULL COMMENT '物流订单号',
  `order_number` varchar(100) DEFAULT NULL COMMENT '沐海网站订单号',
  `express` varchar(50) DEFAULT NULL COMMENT '快递公司',
  `customer` varchar(50) DEFAULT NULL COMMENT '顾客',
  `product_name` varchar(100) DEFAULT NULL COMMENT '产品名称',
  `track_number` varchar(50) DEFAULT NULL COMMENT '发货单号',
  `update_result` text COMMENT '执行修改的orderId结果集',
  `line_number` varchar(100) DEFAULT NULL COMMENT 'excel行数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='excel导入时的数据信息记录';

